css_pattern:
{
    "stock_number": {
        "selector": [
            ".liUnit.LiInvstock-number .unitValue.spnUnitValue",
            ".liUnit.LiInvStockNumber .spnUnitValue",
            "li.liUnit.LiInvstock-number span.unitValue"
        ],
        "transform": "deduplicate_stock"
    },
    "price": {
        "selector": [
            "div.price-price .price-value",
            ".lblUnitLabel .spnUnitValue",
            "#unitPriceBox h2",
            ".price-value",
            ".price"
        ]
    },
    "msrp": {
        "selector": [
            ".price-retail .price-value",
            ".liUnit.LiInvRetailPrice .spnUnitValue"
        ]
    },
    "year": {
        "selector": [
            ".liUnit.LiInvyear .unitValue",
            ".liUnit.LiInvYear .spnUnitValue",
            "li.liUnit.LiInvyear span.unitValue"
        ]
    },
    "class": {
        "selector": [
            ".unitHighlights .liUnit.LiInvcategory .unitValue",
            "li.liUnit.LiInvcategory span.unitValue"
        ]
    },
    "options": {
        "selector": [
            "div.unitHighlights ul",
            ".invUnitInfoTable li"
        ],
        "custom": true,
        "multiple": true
    },
    "listing_address": {
        "selector": [
            "li.LiInvlocation .spnUnitValue",
            ".liUnit.LiInvLocation .spnUnitValue",
            ".footer-full-address abbr",
            ".footer-address-l2 abbr",
            "div.vcard .street-address"
        ]
    },
    "heading": {
        "selector": [
            ".unitTitle h1",
            "h1"
        ]
    },
    "phonelink": {
        "selector": [
            "a.footer-phone__link",
            ".footer-phone a",
            ".collapse-body a",
            ".dealer-phone a",
            ".footer-phone__link",
            ".phone a",
            ".header-phone a",
            ".footer-phone-map a",
            ".dealer-phone-sales a",
            ".footer-column a",
            ".footer-column__content a",
            "a.header-phone__link"
        ],
        "attr": "href"
    },
    "description": {
        "selector": [
            "meta[name='description']"
        ],
        "attr": "content"
    },
    "vin": {
        "selector": [
            ".liUnit.LiInvvin.unitSpec .unitValue.spnUnitValue",
            ".liUnit.LiInvVIN .spnUnitValue",
            "li.liUnit.LiInvvin span.unitValue"
        ]
    },
    "dp_url": {
        "selector": [
            "link[rel='canonical']"
        ],
        "attr": "href"
    },
    "image_urls": {
        "selector": [
            ".lS-image-wrapper img",
            ".background-image-container.item > .background-image",
            ".internalImages li > a",
            "#invImageGallery img"
        ],
        "attr": "src",
        "multiple": true
    },
    "images_count": {
        "selector": [
            ".lS-image-wrapper img",
            ".background-image-container.item > .background-image",
            ".internalImages li > a",
            "#invImageGallery img"
        ],
        "attr": "src",
        "count": true
    }
}

